import './navigation.css';

const Navigation = () => {
    return (
        <div className="navBar">
            <div>
                <button onClick="show" >Menu</button>
            </div>
            <div>
                <button>Meus Livros</button>
            </div>
        </div>
    );
}

export default Navigation;
